import React, { Fragment, useEffect, useState } from 'react';
import ReactHTMLTableToExcel from "react-html-table-to-excel";
import MaterialTable from "material-table";
import axios from "axios";
import Breadcrumb from "../common/breadcrumb";
import data from "../../assets/data/orders";
import Datatable from "../common/datatable";
import {
	Card, CardBody, CardHeader, Col, Container, Form, FormGroup, Input, Label, Row, Button, Modal, ModalFooter,
	ModalHeader, ModalBody
} from "reactstrap";
import swal from "sweetalert";
import Loading from '../elements/Loading/Loading';

const Orders = () => {
	const [lisPedidos, setListPedidos] = useState([]);

	useEffect(() => {
		const newDet = [];
		let contador = 0;
		let contadordos = 0;

		const leePedidos = async () => {
			//setLoading(true);
			const params = {
				pedido: 0
			}
			//console.log("FECHA ", params);
			await axios({
				method: 'get',
				url: 'https://sitbusiness.co/cyclewear/api/210', params
			}).then(res => {
				//console.log("PEDIDOS : ", res.data)
				setListPedidos(res.data);
			}
			).catch(function (error) {
				console.log("ERROR LEYENDO FACTURAS");
			})
		}
		leePedidos();

	}, [])

	const columnas = [
        {
            title: 'Id Pedido',
            field: 'id_fact'
        },
        {
            title: 'Id Siigo',
            field: 'id_siigo'
        },
        {
            title: 'Factura Siigo',
            field: 'facturasiigo'
        },
        {
            title: 'Fecha Pedido',
            field: 'fechafactura'
        },
        {
            title: 'Id Cliente',
            field: 'idcliente'
        },
		{
            title: 'Valor Factura',
            field: 'valorfactura'
        },
		{
            title: 'Descuento',
            field: 'descuento'
        },
		{
            title: 'Observacion',
            field: 'observaciones'
        },

    ]

	return (
		<Fragment>
			<Breadcrumb title="Orders" parent="Sales" />
{
	console.log("PEDIDOS : ", lisPedidos)
}
			<Container fluid={true}>
			<MaterialTable
                    title="Productos Cycle Wear"
                    columns={columnas}
                    data={listProductos}
                    actions={[
                        {
                            icon: EditIcon,
                            tooltip: 'Editar Producto',
                            onClick: (event, rowData) => seleccionarProducto(rowData, "Producto")
                        },
                        {
                            icon: EditAttributesIcon,
                            tooltip: 'Variante Producto',
                            onClick: (event, rowData) => seleccionarProducto(rowData, "Variante")
                        }
                    ]}
                    options={{
                        actionsColumnIndex: 11,
                        headerStyle: { backgroundColor: '#015CAB', fontSize: 16, color: 'white' },
                        rowStyle: {
                            fontSize: 14,
                        }
                    }}
                />
			</Container>
		</Fragment>
	);
};

export default Orders;
